import React from 'react';

function Products(props) {
    return (
        <div>
            <h1>The Product Page</h1>
            <ul>
                <li>Product 1</li>
                <li>Product 2</li>
                <li>Product 3</li>
            </ul>
        </div>
    );
}

export default Products;
